对于一些标记了生命周期，但是其内部没有使用的类型来说，此生命周期由于没有使用，从而导致没有边界，无法进行编译。例如： struct Iter<'a, T: 'a> { ptr: *const T, end: *const T,
} 所以需要修改为： use std::marker; struct Iter<'a, T: 'a> { ptr: *const T, end: *const T, _marker: marker::PhantomData<&'a T>,
}

