比如对于Vec类型来说 struct Vec<T> { data: *const T, // *const for variance! len: usize, cap: usize,
} 删除检查器确定Vec<T>没有拥有任何T类型的任何值。 为了让删除检查器确定我们拥有T类型的值，可以做如下修改 use std::marker; struct Vec<T> { data: *const T, // *const for variance! len: usize, cap: usize, _marker: marker::PhantomData<T>,
}
